from sgrequests import SgRequests
from bs4 import BeautifulSoup
import csv
import re

def write_output(data):
	with open('data.csv', mode='w', encoding="utf-8") as output_file:
		writer = csv.writer(output_file, delimiter=',', quotechar='"', quoting=csv.QUOTE_ALL)

		# Header
		writer.writerow(["locator_domain", "page_url", "location_name", "street_address", "city", "state", "zip", "country_code", "store_number", "phone", "location_type", "latitude", "longitude", "hours_of_operation"])
		# Body
		for row in data:
			writer.writerow(row)

def fetch_data():
	
	base_link = 'https://www.hy-vee.com/stores/store-finder-results.aspx?zip=&state=&city=&olfloral=False&olcatering=False&olgrocery=False&olpre=False&olbakery=False&diet=False&chef=False'

	user_agent = 'Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/80.0.3987.162 Safari/537.36'
	HEADERS = {'User-Agent' : user_agent}

	session = SgRequests()
	req = session.get(base_link, headers = HEADERS)
	base = BeautifulSoup(req.text,"lxml")

	data = []
	found_poi = []

	last_page = base.find(class_="paging").find_all("a")[-2].text

	locator_domain = "hy-vee.com"

	for page_num in range(1,int(last_page)+1):

		if page_num < 4:
			viewstate = ''
			viewstate1 = ''
			validation = ''

		elif page_num < 7:
			viewstate = ''
			viewstate1 = ''
			validation = ''

		elif page_num < 10:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		elif page_num < 13:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		elif page_num < 16:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		elif page_num < 19:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		elif page_num < 22:
			viewstate = ''
			viewstate1 = ''
			validation = ''

		elif page_num < 25:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		elif page_num < 28:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		elif page_num < 31:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		elif page_num < 34:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		elif page_num < 37:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		elif page_num < 40:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		elif page_num < 43:
			viewstate = ''
			viewstate1 = ''
			validation = ''
		
		script_man = 'ctl00$cph_main_content$spuStoreFinderResults$upPaging|ctl00$cph_main_content$spuStoreFinderResults$gvStores$ctl10$Page%s' %page_num
		event = 'ctl00$cph_main_content$spuStoreFinderResults$gvStores$ctl10$Page%s' %page_num

		# Request post
		payload = {'ctl00$ScriptManager1': script_man,
					'ctl00$cph_main_content$spuGasFinderResults$spuGasFinder$txtZip':'',
					'ctl00$cph_main_content$spuGasFinderResults$spuGasFinder$ddlState':'',
					'ctl00$cph_main_content$spuGasFinderResults$spuGasFinder$ddlCity':'',
					'__EVENTTARGET': event,
					'__EVENTARGUMENT':'',
					'__VIEWSTATE': viewstate,
					'__VIEWSTATE1': viewstate1,
					'__VIEWSTATEGENERATOR':'A197F7EF',
					'__EVENTVALIDATION':validation,
					'__VIEWSTATEFIELDCOUNT':'2',
					'__VIEWSTATEENCRYPTED':'',
					'__ASYNCPOST':'true'}

		if str(page_num) == last_page:
			viewstate = ''
			viewstate1 = ''
			validation = ''

			script_man = 'ctl00$cph_main_content$spuStoreFinderResults$upPaging|ctl00$cph_main_content$spuStoreFinderResults$gvStores$ctl05$Page%s' %page_num
			event = 'ctl00$cph_main_content$spuStoreFinderResults$gvStores$ctl05$Page%s' %page_num

			# Request post
			payload = {'ctl00$ScriptManager1': script_man,
						'ctl00$cph_main_content$spuGasFinderResults$spuGasFinder$txtZip':'',
						'ctl00$cph_main_content$spuGasFinderResults$spuGasFinder$ddlState':'',
						'ctl00$cph_main_content$spuGasFinderResults$spuGasFinder$ddlCity':'',
						'__EVENTTARGET': event,
						'__EVENTARGUMENT':'',
						'__VIEWSTATE': viewstate,
						'__VIEWSTATE1': viewstate1,
						'__VIEWSTATEGENERATOR':'A197F7EF',
						'__EVENTVALIDATION':validation,
						'__VIEWSTATEENCRYPTED':'',
						'__ASYNCPOST':'true'}

		# print(script_man)
		response = session.post(base_link,headers=HEADERS,data=payload)
		base = BeautifulSoup(response.text,"lxml")

		items = base.table.find_all(style="border-style:None;")

		for row in range(len(items)):
			item = items[row]

			location_name = item.strong.text.strip()

			raw_address = list(item.stripped_strings)

			for i in range(len(raw_address)):
				if "Main:" in raw_address[i]:
					phone_line = i
			street_address = raw_address[phone_line-2].strip()
			if street_address == "Suite 100" or street_address == "PO Box 895":
				street_address = raw_address[phone_line-3].strip() + " " + street_address
			city = raw_address[phone_line-1].split(",")[0].strip()
			state = raw_address[phone_line-1].split(",")[1].strip()[:-6].strip().replace("Wisconsin","WI")
			zip_code = raw_address[phone_line-1].split(",")[1].strip()[-6:].strip().replace("51264","61264")

			phone = raw_address[phone_line].replace("Main:","").replace("Main","").replace("Store:","").split("toll")[0].split("- Pharmacy")[0].split("/")[0].strip().split(" (")[0].strip()
			country_code = "US"
			location_type = "<MISSING>"

			link = "https://www.hy-vee.com" + item.find_all("a")[-1]["href"]
			store_number = link.split("=")[-1]

			if link in found_poi:
				continue

			found_poi.append(link)

			req = session.get(link, headers = HEADERS)
			base = BeautifulSoup(req.text,"lxml")

			hours_of_operation = base.find(id="page_content").find_all("p")[1].text.replace("\n"," ").replace("\r"," ").encode("ascii", "replace").decode().replace("?","-").strip()
			if not hours_of_operation:
				hours_of_operation = base.find(class_="storeHours table").find_all("td")[1].text.replace("\n","").replace("\r"," ").encode("ascii", "replace").decode().replace("?","-").strip()
			hours_of_operation = (re.sub(' +', ' ', hours_of_operation)).strip()
			hours_of_operation = hours_of_operation.replace("for the general public.","").replace("(midnight)","").split("If need")[0].strip()
			
			try:
				map_link = base.find(id="ctl00_cph_main_content_aMapItWithGoogle")["href"]
				req = session.get(map_link, headers = HEADERS)
				maps = BeautifulSoup(req.text,"lxml")

				try:
					raw_gps = maps.find('meta', attrs={'itemprop': "image"})['content']
					latitude = raw_gps[raw_gps.find("=")+1:raw_gps.find("%")].strip()
					longitude = raw_gps[raw_gps.find("-"):raw_gps.find("&")].strip()
				except:
					latitude = "<MISSING>"
					longitude = "<MISSING>"
			except:
				latitude = "<MISSING>"
				longitude = "<MISSING>"

			data.append([locator_domain, link, location_name, street_address, city, state, zip_code, country_code, store_number, phone, location_type, latitude, longitude, hours_of_operation])

	return data

def scrape():
	data = fetch_data()
	write_output(data)

scrape()
